(3539,	316,	'new_construction_accordion_0_title',	'Higher demand'),
(3540,	316,	'_new_construction_accordion_0_title',	'field_5e3a5f03da601'),
(3541,	316,	'new_construction_accordion_0_content',	' Turn-key properties with stainless steel appliances, ready to rent\r\n\r\n Contemporary home design  in accordance with global and local demand trends (large bedrooms,\r\nopen living space and the kitchen as the heart of the home)\r\n\r\n Energy efficient homes  more families choose to rent a new home because it will save them\r\nsignificant costs on their electricity, water bills and more'),
(3542,	316,	'_new_construction_accordion_0_content',	'field_5e3a5f0cda602'),
(3543,	316,	'new_construction_accordion_1_title',	'Better financial performance'),
(3544,	316,	'_new_construction_accordion_1_title',	'field_5e3a5f03da601'),
(3545,	316,	'new_construction_accordion_1_content',	' High quality tenants who pay on time and take care of your property\r\n\r\n High quality construction adhering to the latest building standards &amp; safety requirements\r\n\r\n High quality neighborhoods - Solid socioeconomic profile and demographical strengths lead to\r\nlonger term leases\r\n\r\n High occupancy rates  newly built communities are in demand, due to the high quality of life and,\r\ntherefore, rent quickly'),
(3546,	316,	'_new_construction_accordion_1_content',	'field_5e3a5f0cda602'),
(3547,	316,	'new_construction_accordion_2_title',	'Better financial stability'),
(3548,	316,	'_new_construction_accordion_2_title',	'field_5e3a5f03da601'),
(3549,	316,	'new_construction_accordion_2_content',	' Benefit from higher appreciation\r\n\r\n Leverage your investment by qualifying for a mortgage\r\n\r\n Avoid high expenses on maintenance with high quality building standards and efficient systems &amp;\r\nappliances.\r\n\r\n Low property insurance  new construction properties have lower premiums, due to lower risk factor\r\n\r\n Pay lower taxes - larger depreciation component, tax-deductible interest and more\r\n\r\n Benefit from the safety of your investment with the 1-2-10 builders warranty'),
